INSERT INTO `cursuri` (`id`, `nume`, `descriere`, `orar`) VALUES
(1, 'All Things JavaScript', '<p>Learn why companies are choosing JavaScript as their technology stack to build applications because it can help them reduce man power, cut back on costs and iterate faster. And on top of it, one other major benefit is that it is open source and free to use.<br>Join us for a three part course on All Things JavaScript:</p><ul><li>We will talk about how JavaScript can be used to replace traditional programming languages for building different kinds of software applications.</li><li>Most of today s apps either mobile, desktop or IoT are connected to some cloud based server for persisting user data or using cloud computing to improve user experience so we have to talk a bit about web development. We will see how Internet clients (browsers, mobile/desktop apps) communicate with backend cloud services and how JavaScript fits into the picture.</li><li>See it in action. After all this praise it is time to see some code. We will use JavaScript to build a simple notes app that can be deployed to all platforms: web, IOS/Android and desktop (Windows, MacOS and Linux). The app will use a server also built using JavaScript to sync notes across devices.</li></ul><p><strong>Difficulty</strong>: <i>beginner-intermediate</i></p><p><strong>Format</strong>: <i>3 courses ~ 2h</i></p>', '<ul><li>Luni, 24 iunie - ora 14:00</li><li>Marti, 25 iunie - ora 14:00</li><li>Viner, 28 iunie - ora 14:00</li></ul>'),
(2, 'Coding Pro-Practices', '<p>This course will take attendees on an explorative journey of problem solving using software. As a programming language we will be using is C++ 17. This language has a two-fold reputation, on one side for performance and efficiency but on the other for memory management issues and lack of libraries. Programming languages and libraries are only tools, and like all tools, it is up to those using them to do so in an efficient manner, to understand their applicability and limitations.</p><p><strong>Difficulty</strong>: <i>intermediate</i></p><p><strong>Format</strong>: <i>3 courses ~ 2h</i></p>', '<ul><li>Luni, 1 iulie - ora 16:00</li><li>Marti, 2 iulie - ora 16:00</li><li>Miercuri, 3 iulie - ora 16:00</li></ul>'),
(3, 'Curry On Functional Programming', '<p>In this workshop we`ll analyze a bunch of FP techniques and see how they help make our code shorter, clearer and faster, by embracing a declarative vs. an imperative style. Brace yourselves for a bumpy ride including composition, lifting, currying, partial application, pure functions, maybe even pattern matching and lazy evaluation.</p><p><strong>Difficulty</strong>: <i>intermediate</i></p><p><strong>Format</strong>: <i>3 courses ~ 2h</i></p>', '<ul><li>Joi, 4 iulie - ora 18:00</li><li>Vineri, 5 iulie - ora 18:00</li><li>Luni, 8 iulie - ora 18:00</li></ul>'),
(4, 'HTML, CSS & JS In The Real World', '<p>In this workshop, we will cover the basics to get you going on using HTML, CSS and JavaScript. After that, you`ll hopefully want to spend more time nitpicking and criticizing a site or web application when you see one. Because doing real work is hard.</p><p><strong>Difficulty</strong>: <i>beginner-intermediate</i></p><p><strong>Format</strong>: <i>3 courses ~ 2h</i></p>', '<ul><li>Luni, 24 iunie - ora 18:00</li><li>Marti, 25 iunie - ora 18:00</li><li>Miercuri, 26 iunie - ora 18:00</li></ul>'),
(5, 'Java Vs Python: Coding Deathmatch', '<p>You will learn what is a REST API, how and why to create one with both Python and Java, how to deploy it and how to manage different coding situations.<br>In the aftermath of this session, you will find which one fits you better, when to use one or another and how to get the most out of both of them.</p><p><strong>Difficulty</strong>: <i>intermediate</i></p><p><strong>Format</strong>: <i>3 courses ~ 2h</i></p>', '<ul><li>Joi, 27 iunie - ora 18:00</li><li>Vineri, 28 iunie - ora 18:00</li><li>Luni, 1 iulie - ora 18:00</li></ul>'),
(6, 'OOP Techniques In A Simple Game', '<p>Get started with object oriented programming in a fun and entertaining way by creating a simple sprite based game using the Cocos2D framework. In the course we will use C++, the gaming industry standard.</p><p><strong>Difficulty</strong>: <i>beginner</i></p><p><strong>Format</strong>: <i>3 courses ~ 2h</i></p>', '<ul><li>Luni, 24 iunie - ora 16:00</li><li>Marti, 25 iunie - ora 16:00</li><li>Miercuri, 26 iunie - ora 16:00</li></ul>'),
(7, 'REST in Node.JS at the React & Angular SPA', '<p>In cadrul cursului vor fi abordate urmatoarele subiecte:</p><ul><li>Fundamentele web</li><li>Servicii REST in Node.js</li><li>Notiuni de baza React</li><li>Solutia React</li><li>Notiuni de baza Angular</li><li>Angular in practica</li></ul><p><strong>Difficulty</strong>: <i>beginner-intermediate</i></p><p><strong>Format</strong>: <i>6 courses ~ 2h</i></p>', '<ul><li>Miercuri, 26 iunie - ora 14:00</li><li>Joi, 27 iunie - ora 14:00</li><li>Miercuri, 3 iulie - ora 14:00</li><li>Joi, 4 iulie - ora 14:00</li><li>Miercuri, 10 iulie - ora 14:00</li><li>Joi, 11 iulie - ora 14:00</li></ul>'),
(8, 'Sneak Peek Into Next Level QA (Test Automation)', '<p>Even the most conscientious tester will make mistakes during monotonous manual testing. Automated tests perform the same steps precisely every time they are executed and never forget to record detailed results.<br>FREE yourself from manual testing, and gain more time to create new automated software tests and deal with complex features.</p><p><strong>Difficulty</strong>: <i>beginner-intermediate</i></p><p><strong>Format</strong>: <i>2 courses ~ 2h</i></p>', '<ul><li>Marti, 25 iunie - ora 18:00</li><li>Miercuri, 26 iunie - ora 18:00</li></ul>'),
(9, 'Windows App Development With .NET WPF', '<p>In this course, we will learn how to create and improve a desktop application using .NET WPF (Windows Presentation Foundation).<br>The lecture covers the importance of continuously improving your code and software architecture. More than that, we will show you how to do it. Let`s discover together the design pattern that stands behind the WPF Framework and how to use modern tools to create a better product.</p><p><strong>Difficulty</strong>: <i>beginner-intermediate</i></p><p><strong>Format</strong>: <i>2 courses ~ 2h</i></p>', '<ul><li>Joi, 27 iunie - ora 16:00</li><li>Vineri, 28 iunie - ora 16:00</li></ul>'),
(10, 'You`ll Neversea Algorithms Like These', '<p>Is the performance still relevant in these days when the hardware is becoming more and more efficient and the computation costs goes down?</p><p>Now you can even use computation services without bothering of managing physical hardware, is there any reason why you should think about the performance and efficiency?</p><p>I`ll give you two reasons why you should think twice before you`ll choose to implement a naive solution instead of a natural algorithmical approach.</p><p><strong>Difficulty</strong>: <i>intermediate</i></p><p><strong>Format</strong>: <i>3 courses ~ 2h</i></p>', '<ul><li>Joi, 4 iulie - ora 16:00</li><li>Vineri, 5 iulie - ora 16:00</li><li>Luni, 8 iulie - ora 16:00</li></ul>');

